В компанию "БУРГЕР КИНГ РОССИЯ" требуется Помощник менеджера по подбору персонала

ЗП от 20 000 руб. на руки

Что нужно делать:
🔹 искать резюме кандидатов на позиции повар/кассир (массовый подбор) на территории РФ;
🔹 проводить телефонные интервью с кандидатами на открытые вакансии;
🔹 поддерживать базу резюме в активном состоянии;
🔹 публиковать вакансии на работных сайтах и в социальных сетях;
🔹 вести отчетность;
🔹 участвовать в Hr проектах компании;
🔹 и самое главное - общаться с директорами ресторанов и работать с ними вместе для привлечения лучших людей в Компанию!

Что мы ждем от тебя:
🔹 ты студент или выпускник, и хочешь развиваться в сфере Hr;
🔹 имеешь отличные коммуникативные навыки (мы много общаемся друг с другом, с гостями и с кандидатами);
🔹 владеешь Exсel и другими MS Office программами (мы не теряем информацию и бережно храним сведения о сотрудниках и кандидатах);
🔹 готов к большому объему информации (мы готовы поручить тебе часть работы над проектом, если ты будешь готов);
🔹 хочешь изучить процессы Hr, чтобы стать профессионалом в своей области (а мы любим учить);
🔹 умеешь эффективно работать в большой команде (welcome). Мы предлагаем тебе:
🔹 гордиться собой: работа в крупной международной компании;
🔹 находиться в команде лучших: сплоченный коллектив единомышленников;
🔹 уверенность в завтрашнем дне: оформление по ТК РФ, «белая» заработная плата от 20000 рублей;
🔹 ежеквартальная премия по результатам работы после испытательного срока в размере одного оклада;
🔹 развиваться вместе с нами: карьерный рост и профессиональное развитие;
🔹 возможен удаленный формат работы - обсуждается индивидуально с финальным кандидатом.

